import { Page, TextStyle, Layout } from '@shopify/polaris';

const Index = () => (
	<Page>
		<Layout>
			<TextStyle variation='positive'>
				<p>Sample app using React and Next.js</p>
			</TextStyle>
		</Layout>
	</Page>
);

export default Index;
